const Loading = () => {
  return (
    <div class="d-flex justify-content-center">
        <div class="spinner-border text-success" role="status" style={{width:'50px', height:'50px'}}>
        <span class="sr-only" style={{display: 'hidden'}}>Loading...</span>
    </div>
    </div>
  )
}

export default Loading
